I’m proud to champion the Chloe Cole Act in the U.S. House of Representatives. 

It’s time to put an end to these barbaric chemical and surgical mutilations and empower the victims of these radical procedures. 

This bill will: 

• Prohibit physicians, clinics, and hospitals from participating in chemical or surgical mutilation of minors;

• Define sex as a biological reality, NOT a political label;

• Establish a private right of action, allowing victims and their families to seek civil damages against those who harmed them;

• And extend the statute of limitations to ensure that survivors have ample time to pursue justice, even decades later.

At one time, manufacturing was the backbone of the American middle class. @HouseGOP and @POTUS are committed to bringing these vitally important jobs back to America. Thank you @club4growth for your work on this consequential issue. 

